import React from "react";

class Titles extends React.Component {

  render() {
    return (
      <div>
        <a href="https://imgbb.com/"><img src="https://i.ibb.co/MSFL07F/logo-2x.png" alt="logo-2x" border="0"/></a>
      </div>
    );
  }
};

export default Titles;
